ISLAMABAD, Nov 28 (APP):Speaker National Assembly Sardar Ayaz Sadiq along with a parliamentary delegation called on the Chairman of State Duma of the Federal Assembly of the Russian Federation, Volodin Vyacheslav Victorovich in Moscow during the three-day official visit.
The invitation for the official visit to Russia was extended by the Chairman of the State Duma of the Russian Federation to the Speaker of the National Assembly of Pakistan, said a news release received here on Thursday.
